import Head from 'next/head'

//Los componente en react siempre empiezan con mayúscula
const Index = () =>{
    return (
        <div>
            <Head>
                <title>Tolouse</title>
            </Head>
            <Navigation/>
            <h1>Hola!!</h1>
        </div>
    
    )
}

export default Index;
